        if ($spieler['zusatzpunkte'] > 0) {
          $zusatzpunkte = $spieler['kontrare'] == 'Kontra' ? $spieler['zusatzpunkte'] : -$spieler['zusatzpunkte'];
        }
      }
      $points['Re'] = $merkpunkte;
      $points['Kontra'] = $merkpunkte;
      if ($recount == 1) $solo = 1;
      if ($merkpartei == "Re") {
        $points['Kontra'] = $solo == 1 ? -$merkpunkte / 3 : -$merkpunkte;
      }
      if ($merkpartei == "Kontra") {
        $points['Re'] = $solo == 1 ? -$merkpunkte * 3 : -$merkpunkte;
      }
      foreach ($spiel as $spieler) {
        array_push(
          $games,
          array(
            'listId' => $listId,
            'gameId' => $spieler['spielid'],
            'playerId' => $spieler['spielerid'],
            'date' => $spieler['datum'],
            'points' => $points[$spieler['kontrare']],
            'kontrare' => $spieler['kontrare'],
            'extrapoints' => $zusatzpunkte,
            'solo' => $solo,
            'pronounced' => -$spieler['angesagt'],
            'played' => -$spieler['gespielt']
          )
        );
      }
    }
    $listId++;
  }
}
